import React, { useEffect, useState } from "react";
import { MapContainer, TileLayer, ZoomControl } from "react-leaflet";
import { PageContainer, Title } from "./styles/solution_style.js";
import { Map as MapProp, tileLayer } from "leaflet";

const clouds = TileLayer(
  "https://{s}.tile.openweathermap.org/map/clouds_new/{z}/{x}/{y}.png?appid=e6d8c9c20269bd6d193a610ab4f7d761",
  {
    attribution:
      'Map data &copy; <a href="http://openweathermap.org">OpenWeatherMap</a>',
  }
);

function Solution() {
  const [map, setMap] = (useState < MapProp) | (null > null);

  useEffect(() => {
    if (!map) return;

    map.addLayer(clouds);
  }, [map]);

  return (
    <PageContainer>
      <MapContainer
        center={[39.1, -76.1]}
        zoom={10}
        scrollWheelZoom={true}
        zoomControl={false}
      >
        <TileLayer
          url="https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png"
          attribution='&copy; <a href="http://osm.org/copyright">OpenStreetMap</a>'
        />
        <ZoomControl position="topright" />
      </MapContainer>
    </PageContainer>
  );
}

export default Solution;
